        <input placeholder="Enter your name"
          type="text" 
          value={name}
          onChange={(e) => setName(e.target.value)}
        //   onKeyUp={this.handleChange.bind(this)}
        />
      </label>
      <button>Click Me </button>
    </form>

  )
}
